import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import MenuItem from "@material-ui/core/MenuItem";

import { useSelector, useDispatch } from "react-redux";
import { setMediaType, setMediaLink } from "../store/action.js";

const mediaTypes = [
  {
    value: "instegram",
    label: "לינק לאינסטגרם",
  },
  {
    value: "facebook",
    label: "לינק לפייסבוק",
  },
  {
    value: "tiktok",
    label: "לינק לטיקטוק",
  },
  {
    value: "twitter",
    label: "לינק לטוויטר",
  },
];

const useStyles = makeStyles((theme) => ({
  root: {
    "& .MuiTextField-root": {
      margin: theme.spacing(1),
      width: "25ch",
    },
  },
}));

export function MultilineTextFields() {
  const dispatch = useDispatch();
  const classes = useStyles();
  const [type, setMediaType] = React.useState("instegram");

  const { mediaType } = useSelector((state) => state.mediaModule);
  console.log("mediaTypemediaType", mediaType);

  const handleChange = (event) => {
    setMediaType(event.target.value);
    dispatch(setMediaType(event.target.value));
    console.log("event.target.value", event.target.value);
  };

  return (
    <form className={classes.root} noValidate autoComplete="off">
      <div>
        <TextField
          id="outlined-select-currency"
          select
          label=""
          value={type}
          onChange={handleChange}
          helperText=""
          variant="outlined"
        >
          {mediaTypes.map((option) => (
            <MenuItem key={option.value} value={option.value}>
              {option.label}
            </MenuItem>
          ))}
        </TextField>
      </div>
    </form>
  );
}
